import React, { PureComponent } from 'react';
import { Button } from 'antd';

class DelButton extends PureComponent {

    render() {
        return (
            <div>
                <Button onClick={() => {
                    this.props.deleteuser(this.props.id)
                }}>Del</Button>
            </div>
        )
    }
}

export default DelButton;
